<div class="entities" style="line-height: 2.5; direction: ltr">Therapy with interferon-beta modulates endogenous catecholamines in lymphocytes of patients with multiple sclerosis . OBJECTIVE : To investigate the endogenous dopaminergic / adrenergic system of lymphocytes in multiple sclerosis ( MS ) patients during treatment with interferon ( IFN ) - beta . METHODS : Patients with relapsing-remitting MS undergoing IFN-beta treatment were prospectively studied during the first year of treatment . Circulating lymphocytes were obtained at baseline and after 1 , 3 , 6 and 12 months of treatment and assayed for catecholamine ( CA ) production and mRNA expression of tyrosine hydroxylase ( TH , the rate-limiting enzyme in the synthesis of CA ) , beta ( 2 ) - adrenoceptors ( AR ) and D2 , D3 and D5 dopaminergic receptors ( DR ) . RESULTS : In cells from patients treated with IFN-beta for 12 months the production of CA hugely increased and was less sensitive to

 - induced inhibition . Expression of mRNA for TH , beta ( 2 ) - AR and

 was already enhanced after 1 month and further increased up to 6-12 months of treatment . On the contrary , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 mRNA progressively decreased and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 inhibitors up-regulate anti-aging klotho mRNA via RhoA inactivation in IMCD 3 cells . OBJECTIVE : Q9UEF7 is thought to play a critical role in the development of age-related disorders including arteriosclerosis . Statins may exert vascular protective effects , independent of the lowering of plasma cholesterol levels . We investigated the impact of statins on mRNA expression of the age-suppressor gene , klotho in mIMCD 3 cells . METHODS AND RESULTS : Q9UEF7 mRNA levels were evaluated with real-time RT-PCR . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01076

 and pitavastatin increased the expression of klotho mRNA in a dose-dependent manner . This stimulatory effect was abolished by the addition of mevalonate , GGPP and FPP , essential molecules for isoprenylation of the small GTPase Rho . As was the case with the statin treatment , inhibition of Rho-kinase by Y27632 up-regulated klotho mRNA . In contrast to the statin treatment , stimulation with angiotensin II down-regulated klotho mRNA expression without obvious morphological changes . Furthermore , pretreatment with atorvastatin blunted the angiotensin II-induced response and ameliorated the decrease in klotho mRNA expression towards basal levels . RhoA activity was further evaluated by detection of its translocation . Angiotensin II activated RhoA , whereas statins potently inactivated RhoA and blocked RhoA activation by angiotensin II . CONCLUSION : Statins inactivate the RhoA pathway , resulting in over-expression of klotho mRNA , which may contribute to the novel pleiotropic effects of statins towards vascular protection .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Activation of PPARgamma by rosiglitazone attenuates intestinal Cl - secretion . The thiazolidinedione ( TZD ) drugs rosiglitazone ( Ro ) and pioglitazone ( Po ) are PPARgamma agonists in widespread clinical use as insulin-sensitizing agents in Type 2 diabetes . On the basis of recent evidence implicating PPARgamma as a positive modulator of intestinal epithelial differentiation , we hypothesized that TZD drugs might attenuate intestinal secretory function . To evaluate this possibility , we examined the effects of Ro and Po on electrogenic Cl - secretion [ short-circuit current ( I ( sc ) ) ] in mouse intestinal segments and in cultured human intestinal epithelial cells ( HT29 - Cl . 19A ) . As hypothesized , oral administration of Ro ( 20 mg.kg ( - 1 ) . day ( - 1 ) ) to mice for 8 days markedly reduced intestinal I ( sc ) responses to DB02527 ( forskolin ) - and Ca2 + ( carbachol ) - dependent stimuli . In these Ro-treated mice , cholera toxin-induced intestinal fluid accumulation was reduced 65 % . With continued Ro treatment , the I ( sc ) response to carbachol recovered significantly , whereas that to forskolin remained attenuated . Treatment of HT29 cells for 5 days with 10 muM Ro or Po in vitro brought about a similar hyposecretory state . In HT29 cells , the loss of DB02527 - dependent Cl - secretion was attributable to a reduced expression of

<h2 style="margin: 0">19</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Enhancement of cytotoxicity of natural product drugs against multidrug resistant variant cell lines of human head and neck squamous cell carcinoma and breast carcinoma by tesmilifene . N , N-diethyl - 2 - [ 4 - ( phenylmethyl ) phenoxyl ] ethanamine ( tesmilifene ) , a tamoxifen derivative with antihistamine activity , greatly enhanced the survival of doxorubicin-treated , advanced stage breast cancer patients in a phase III trial . However , the molecular basis of tesmilifene action is not firmly established . The effects of tesmilifene on activity of several anticancer drugs was investigated using human head and neck squamous cell carcinoma ( HNSCC ) and breast carcinoma cell lines as a model system . Multidrug resistant ( MDR ) variants of an HNSCC cell line , HN - 5a / V15e , and a breast carcinoma cell line , MCF - 7 / V25a , both highly overexpressed mdr 1 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P08183
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) mRNA and the proteins P-glycoprotein and glutathione transferase-pi . Drug sensitivities were measured by a vital stain after 4 days of continuous exposure to anticancer drug in the absence and presence of tesmilifene at a concentration that alone had no antiproliferative effect . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB04905
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 had minimal effect on drug cytotoxicity against the parental cell lines . However , the same tesmilifene treatment enhanced cytotoxicity of docetaxel , paclitaxel , epirubicin , doxorubicin , and vinorelbine against both MDR cell lines by up to 50 % . Flow cytometric measurement of annexin V / propidium iodide staining demonstrated that tesmilifene increased the killing of HN - 5a / V15e cells caused by docetaxel after 24 and 48h exposure . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB04905
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 increased accumulation of radiolabelled vincristine in HN - 5a / V15e cells , over 4h , by up to 100 % . The results suggest that tesmilifene might be effective in the treatment of tumors that are resistant to natural product drugs . The mechanism of enhancement appears to be related to expression of an ABC pump-dependent , MDR phenotype .</div>
